import "./Navbar.css";
// import { Route, Routes } from "react-router-dom";
import { NavLink } from "react-router-dom";

function Navbar() {
  return (
    <>
      <div className="navbar">
        <h2 className="navbarHeader">Navigate to:</h2>
        <div className="navbarList">
          <NavLink className="navLink" to="/">
            home page
          </NavLink>
          <NavLink
            style={({ isActive }) => {
              return {
                color: "var(--decorative-color)",
              };
            }}
            className="navLink"
            to="/sketch-01"
          >
            sketch-01
          </NavLink>
          <NavLink
            className={({ isActive }) =>
              isActive ? "nav-link active" : "nav-link"
            }
            to="/sketch-02"
          >
            sketch-02
          </NavLink>
          <NavLink className="navLink" to="/sketch-03">
            sketch-03
          </NavLink>
          <NavLink className="navLink" to="/sketch-04">
            sketch-04
          </NavLink>
          <NavLink className="navLink" to="/sketch-05">
            sketch-05
          </NavLink>
        </div>
      </div>
    </>
  );
}

export default Navbar;
